'use strict';

// MAIN //

/**
* Ends a benchmark.
*
* @private
*/
function end() {
	/* eslint-disable no-invalid-this */
	/* jshint validthis: true */ // TODO: remove
	if ( this._ended ) {
		this.fail( '.end() called more than once' );
	} else {
		this.emit( 'end' );
	}
	this._ended = true;
} // end FUNCTION end()


// EXPORTS //

module.exports = end;
